import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import LoginComponent from './Login';
import Home from './Home'; // Make sure this file exports a React component named Home
import Contact from './Contact';
//import FoodAdmin from './pages/Admin/FoodCourt';
import 'bootstrap/dist/css/bootstrap.min.css';
import Stationary from './Stationary';
import Teacher from './Teacher/TeacherDashboard';

import Food from './Services/Canteen';
import AdminHome from './Admin/AdminHome';
import Student from './StudentHome'
import StudentPlace from './StudentPlace';
import Cart from './Services/Foodcart';
import TeacherDashboard from './Teacher/TeacherDashboard';

// SignUp component as before
const SignUp = () => (
  <div className="min-h-screen flex flex-col justify-center items-center bg-gradient-to-r from-yellow-400 via-red-500 to-pink-500 text-white px-4">
    <h1 className="text-5xl font-extrabold mb-6 drop-shadow-lg">Sign Up Page</h1>
    <p className="text-lg mb-8 max-w-lg text-center drop-shadow-md">Sign up form goes here. Build it up with your preferred UI components.</p>
    <Link to="/login" className="bg-white bg-opacity-20 hover:bg-opacity-40 transition px-6 py-3 rounded-xl font-semibold shadow-lg">
      Back to Login
    </Link>
  </div>
);

// NotFound component as before
const NotFound = () => (
  <div className="min-h-screen flex flex-col justify-center items-center bg-gray-900 text-red-400 px-4">
    <h2 className="text-6xl font-bold mb-4 drop-shadow-lg">404</h2>
    <p className="text-xl mb-8 drop-shadow-md">Page Not Found</p>
    <Link to="/" className="text-white underline hover:text-gray-300 transition">
      Go Home
    </Link>
  </div>
);

function App() {
  return (
    <Router>
      <Routes>
        {/* Root path shows imported Home component */}
        <Route path="/" element={<Home />} />

        {/* Login Route */}
        <Route path="/login" element={<LoginComponent />} />

        {/* SignUp Route */}
        <Route path="/Contact" element={<Contact />} />

        <Route path="/Stationary" element={<Stationary />} />

        <Route path="/Food" element={<Food />} />

        <Route path="/AdminHome" element={<AdminHome />} />

        <Route path="/cart" element={<Cart />} />

        <Route path="/Student" element={<Student />} />

        <Route path="/StudentPlace" element={<StudentPlace />} />

        <Route path="/Teacher" element={<TeacherDashboard />} />



        {/* Catch-all 404 */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
